import { AiOutlineMenu } from 'react-icons/ai';
import classes from '../Components.module.css';
const Navbar = () => {
  return (
    <>
      <div className={classes.navMenu}>
        <AiOutlineMenu />
        <h1>GroceList</h1>
        <div className={classes.nav_end}></div>
      </div>
      <nav className={classes.nav_menu_active}>
        <ul className={classes.nav_menu_items}>
          {SidebarData.map((item, index) => {
            if (props.data.activeuser === 'User') {
              if (
                item.path === '/stockControl' ||
                item.path === '/shipments' ||
                item.path === '/reports'
              ) {
                return null;
              } else {
                <li key={index} className={classes.nav_text}>
                  <Link to={item.path}>
                    {item.icon}
                    <span>{item.title}</span>
                  </Link>
                </li>;
              }
            }
            return (
              <li key={index} className={classes.nav_text}>
                <Link to={item.path}>
                  {item.icon}
                  <span>{item.title}</span>
                </Link>
              </li>
            );
          })}
        </ul>
      </nav>
    </>
  );
};
export default Navbar;
